// SPDX-License-Identifier: GPL-3.0

pragma solidity >= 0.7.0 < 0.9.0;

contract Counter {
    uint256 public count;

    function increment(uint256 value) public {
        count = count + value;
    }

    // on modifie la sémantique de cette fonction en faisant appel au modifier isNegative
    function decrement(uint256 value) public isNegative(value) {
        count = count - value;
    }

    // permet de modifier l'éxécution du code source sur la blockchain    
    modifier isNegative(uint256 value) {
        // require permet d'ajouter des conditions pour l'application de cette fonction
        // require prend 2 paramètres : la condition et le message d'erreur
        require(value >= 10, 'Count cannot be negative.');
        
        // _; correspond à l'éxécution de la fonction
        _;
    }
}

